import React from 'react'
import { AiFillHome } from 'react-icons/ai'
import NavSearch from './navSearch'
import NavUser from './navUser'

const handleClick = e => {
    document.location.href="/homepage"
}

const Navbar = (props) => {
    return(
        <div className="navbar_div">
            <div className="navbar_icon">
                <AiFillHome style={home_btn} onClick={handleClick}/>
            </div>
            <div className="navbar_search">
                <NavSearch handleSearching={props.handleSearching} searching={props.searching} handleSearchTerm={props.handleSearchTerm} searchTerm={props.searchTerm}/>
            </div>
            <div className="navbar_user">
                <NavUser />
            </div>

        </div>
    );
}


const home_btn = {
    height: "5vh",
    width: "5vh",
    marginTop: "1.5vh",
    paddingLeft: "20px",
    color: "white"
}
export default Navbar
